// Access the profile data from the PhantomBuster response
const profileData = $('Filter3').first().json; // Directly use $json to access the data

// Create a new object with all required and available fields
const result = {
  fullName: profileData.firstName + " " + profileData.lastName,
  jobTitle: profileData.linkedinJobTitle,
  companyIndustry: profileData.companyIndustry,
  companyName: profileData.companyName,
  location: profileData.location,
  schoolName: profileData.linkedinPreviousSchoolName,
  specialties: profileData.linkedinSkillsLabel,
  industry: profileData.companyIndustry,
  profileUrl: profileData.linkedinProfileUrl,
  linkedinProfileId: profileData.linkedinProfileId,
  linkedinHeadline: profileData.linkedinHeadline,
  linkedinFollowersCount: profileData.linkedinFollowersCount,
  linkedinConnectionsCount: profileData.linkedinConnectionsCount,
  linkedinIsHiringBadge: profileData.linkedinIsHiringBadge,
  linkedinIsOpenToWorkBadge: profileData.linkedinIsOpenToWorkBadge,
  linkedinPreviousCompanyName: profileData.linkedinPreviousCompanyName,
  linkedinPreviousJobTitle: profileData.linkedinPreviousJobTitle,
  linkedinPreviousJobDescription: profileData.linkedinPreviousJobDescription,
  linkedinSchoolDegree: profileData.linkedinSchoolDegree,
  linkedinSchoolDescription: profileData.linkedinSchoolDescription,
  concatenatedMessage: $('Loop Over Items').first().json.concatenated_message
};

// Create a personalized prompt for the lead with sentiment analysis on the concatenated messages
const prompt = `
You will analyze the following concatenated messages exchanged with the lead to determine the sentiment and interest level.

Messages:
${result.concatenatedMessage}

First, perform sentiment analysis on these messages to decide if the client is interested. Look for positive replies or engagement indicating interest.

If the client is not interested, replies negatively, or the reply is about something else and not in the scope of being interested/not interested, respond ONLY with:
"Client is not interested."

If the client is interested, proceed to create a personalized presentation based on the lead's profile:

- **Full Name**: ${result.fullName}
- **Job Title**: ${result.jobTitle}
- **Industry**: ${result.companyIndustry}
- **Company**: ${result.companyName}
- **Location**: ${result.location}
- **Education**: ${result.schoolName}
- **Skills**: ${result.specialties}
- **Industry**: ${result.industry}
- **LinkedIn Profile**: ${result.profileUrl}
- **LinkedIn Headline**: ${result.linkedinHeadline}
- **LinkedIn Followers Count**: ${result.linkedinFollowersCount}
- **LinkedIn Connections Count**: ${result.linkedinConnectionsCount}
- **Hiring Badge**: ${result.linkedinIsHiringBadge}
- **Open to Work Badge**: ${result.linkedinIsOpenToWorkBadge}
- **Previous Company**: ${result.linkedinPreviousCompanyName}
- **Previous Job Title**: ${result.linkedinPreviousJobTitle}
- **Previous Job Description**: ${result.linkedinPreviousJobDescription}
- **School Degree**: ${result.linkedinSchoolDegree}
- **School Description**: ${result.linkedinSchoolDescription}

The presentation should focus on:
1. The lead's role and pain points (e.g., challenges they face in their industry).
2. How our product/solution can help them based on their job title and industry.
3. Relevant case studies that match their company size or industry.
4. A clear call to action.
`;

// Return the structured prompt along with the profile data and concatenated messages
return [{
  json: {
    prompt: prompt,
    data: result // Include the result object with the profile data and concatenated messages
  }
}];

